(function(g){function z(n){return n<10?"0"+n:n}function f(d,fm){var y=d.getFullYear();return fm.replace(/YYYY/g,y).replace(/YY/g,String(y).slice(-2)).replace(/MM/g,z(d.getMonth()+1)).replace(/DD/g,z(d.getDate())).replace(/HH/g,z(d.getHours())).replace(/mm/g,z(d.getMinutes())).replace(/ss/g,z(d.getSeconds()))}g.dayjs=function(d){d=d?new Date(d):new Date();return{format:function(fmt){return f(d,fmt)}}};})(this);
